import { Injectable } from '@angular/core';
import { Category } from '../models/category';

@Injectable({
  providedIn: 'root'
})
export class CategoryService {
  url ="Category";
  constructor() { }

  public getCategory(): Category[]{
    let category = new Category();
    category.id = 1;
    category.name = "bilgisayar";

    return [category];
  }
}
